import React, { Component } from 'react'

export default class Chart extends Component {
    render() {
        return (
            <div>
                <ReactHighcharts key={item.id} highcharts={Highcharts} config={item.chartOptions} ref="chart" oneToOne={true}/>
            </div>
        )
    }
}
